import React from "react";

const SideBar = () => {
  return (
    <div class="side_bar">
      <div class="side_bar_items">
        <form>
          <label>
            Name:
            <input type="text" name="name" />
          </label>
        </form>
      </div>
    </div>
  );
};
export default SideBar;
